import React from "react";
import TextField from "@material-ui/core/TextField";

export default function FormDetail() {
  return (
    <div>
      <TextField id="standard-basic" label="Name" />
      <TextField id="standard-basic" label="Email" type="email" />
    </div>
  );
}
